        return "<img class=\"imagenes_ttpp_aper_cierre\" src=\"/images/upload/trabajos-programados/".concat(row.IMAGENAPERTURA, "\"\n                            data-uno=\"/images/upload/trabajos-programados/").concat(row.IMAGENAPERTURA, "\" data-dos=\"Imagen de Apertura\"\n                            alt=\"Detalle Imagen Apertura\" title=\"Detalle Imagen Apertura\"\n                        />  ");
